import React from "react";
import { useHistory } from "react-router-dom";
const LeftSideContactUs = ({ setType }) => {
  const history = useHistory();
  return (
    <div>
      <div style={{ marginTop: "35%" }}>
        <label
          style={{
            color: "#3C3C3C",
            fontSize: "25px",
            fontWeight: "700",
          }}
        >
          Contact Us
        </label>
      </div>
    </div>
  );
};

export default LeftSideContactUs;
